/// Returns the index of the node relative to the parent node.
#[no_mangle]
pub extern "C" fn AzCallbackInfo_getIndexInParent(
    callbackinfo: &mut AzCallbackInfo,
    node_id: AzDomNodeId,
) -> usize {
    let mut t = 0;
    let mut n = node_id;
    while let Some(prev) = callbackinfo.get_previous_sibling(n) {
        n = prev;
        t += 1;
    }
    t
}
